import { useState } from 'react';
import { NavLink } from 'react-router-dom';
import './NavLinks.css';

const NavLinks = props => {
  const [navChange,setNavChange]  = useState(false);
  const navChangeHandler = () => {
     setNavChange(true);

  }

  return (
    <ul className="nav-links">
      <li>
        <NavLink to="/" exact>
          Toll entries/Vehicle entries
        </NavLink>
      </li>

        <li>
          <input type="search" placeholder="Search vehicle"></input>
          <span cl></span>
        </li>

      {/* {auth.isLoggedIn && (
        <li>
          <NavLink to={`/${auth.userId}/places`}>DETAILS</NavLink>
        </li>
      )} */}

        <li>
          <button >Add vehicle entry</button>
        </li>
        <li>
          <button >Add new toll</button>
        </li>
        <li>
        { !navChange && <NavLink to="/toll" exact onClick={navChangeHandler}>
          View all tolls
        </NavLink>}
      </li>
      {  navChange && <NavLink to="/" exact>
          Back to vehicle logs
        </NavLink>}

    </ul>
  );
};

export default NavLinks;
